import React from 'react';

const Footer = () => {
	return (
		<React.Fragment>
			<footer>
				<hr />
				Developed by
				<a href='https://www.linkedin.com/in/satwik-ghosh-1b071613a/' target='_blank'>
					{' '}
					Satwik Ghosh
				</a>
			</footer>
		</React.Fragment>
	);
};

export default Footer;
